import React from 'react';

function Footer() {
  return (
    <footer style={{textAlign: 'center', padding: '1em', background: '#1976d2', color: '#fff', marginTop: '2em', borderRadius: '0 0 8px 8px'}}>
      &copy; {new Date().getFullYear()} CloudCommerce. All rights reserved.
    </footer>
  );
}

export default Footer;
